    let hash = window.location.hash;
    let home, profile, head;
    if (hash.startsWith("#profile")) {
          head = <HeadMenu />
          profile=<Profile />
    }

    if (!!hash.startsWith("#home")) {
      console.log(hash.startsWith("#home"));
      return (
        <React.Fragment>
          <HeadMenu />
        </React.Fragment>
      );
    }
  });

  return (
    <React.Fragment>
      <Login />
    </React.Fragment>
  );
}

